import ReactDOM from 'react-dom';


const Otsikko = (props) => {
  return (
    <div>
    <h1>{props.kurssi}</h1>
    </div>
  )
}

const Sisalto = (props) => {
  return (
    <div>
    <Osa1 osa1={props.osa1} tehtavia1={props.tehtavia1}/>
    <Osa2 osa2={props.osa2} tehtavia2={props.tehtavia2}/>
    <Osa3 osa3={props.osa3} tehtavia3={props.tehtavia3}/>
    </div>
  )
}

const Osa1 = (props) => {

  return (
    <div>
      <p>{props.osa1}</p>
      <p>{props.tehtavia1}</p>
    </div>
  )
}
const Osa2 = (props) => {

  return (
    <div>
      <p>{props.osa2}</p>
      <p>{props.tehtavia2}</p>
    </div>
  )
}

const Osa3 = (props) => {

  return (
    <div>
      <p>{props.osa3}</p>
      <p>{props.tehtavia3}</p>
    </div>
  )
}



const Yhteensa = (props) => {
  return (
    <div>
    <p>yhteensä {props.tehtavia1 + props.tehtavia2 + props.tehtavia3} tehtävää</p>
    </div>
  )
}


  const App = () => {
